import { IntestComponent } from './intest/intest.component';
import { BindingComponent } from './binding/binding.component';


@NgModule({
  declarations: [
    AppComponent,
    IntestComponent,
    BindingComponent
  ],
  imports: [
    BrowserModule,
    FormsModule //per il two-way binding
  ],
  providers: [],
  bootstrap: [AppComponent]
})
